import logo from "./logo.svg";
import "./css/App.css";
import { Head } from "./Head";
import { Body } from "./Body";

function App() {
  return (
    <div className="App">
      <Head />
      <Body />
      <header className="App-header">
        <p></p>
      </header>
    </div>
  );
}

export default App;
